package com.github.diegopacheco.sandbox.java.imgs;

import java.io.File;
import java.io.FileNotFoundException;
import java.io.FileOutputStream;
import java.io.IOException;
import java.util.Base64;
import java.util.Base64.Decoder;

public class Base64MainFun {
	public static void main(String[] args) throws Throwable {
		
		genPNG();
		genJPG();
		
	
	}

	private static void genPNG() throws FileNotFoundException, IOException {
		Decoder decoder = Base64.getDecoder(); 
		byte[] imgBytes = decoder.decode("");
		
		String path = new File("").getAbsolutePath();
		FileOutputStream osf = new FileOutputStream(path + "\\generated.png");
		System.out.println("Writting in: " + path);
		
		osf.write(imgBytes);
		osf.flush();
		osf.close();
		
		System.out.println("DONE");
	}
	
	private static void genJPG() throws FileNotFoundException, IOException {
		Decoder decoder = Base64.getDecoder(); 
		byte[] imgBytes = decoder.decode("");
		
		String path = new File("").getAbsolutePath();
		FileOutputStream osf = new FileOutputStream(path + "\\generated.jpg");
		System.out.println("Writting in: " + path);
		
		osf.write(imgBytes);
		osf.flush();
		osf.close();
		
		System.out.println("DONE");
	}
}
